CKEDITOR.plugins.setLang("a11yhelp","ca",{title:"Instruccions d'Accessibilitat",contents:"Continguts de l'Ajuda. Per tancar aquest quadre de di\xe0leg premi ESC.",legend:[{name:"General",items:[{name:"Editor de barra d'eines",legend:"Premi ${toolbarFocus} per despla\xe7ar-se per la barra d'eines. Vagi en el seg\xfcent i anterior grup de barra d'eines amb TAB i SHIFT-TAB. Vagi en el seg\xfcent i anterior bot\xf3 de la barra d'eines amb RIGHT ARROW i LEFT ARROW. Premi SPACE o ENTER per activar el bot\xf3 de la barra d'eines."},{name:"Editor de quadre de di\xe0leg",legend:"Dins d'un quadre de di\xe0leg, premi la tecla TAB per despla\xe7ar-se al seg\xfcent camp del quadre de di\xe0leg, premi SHIFT + TAB per despla\xe7ar-se a l'anterior camp, premi ENTER per acceptar el quadre de di\xe0leg, premi ESC per cancel\xb7lar el quadre de di\xe0leg. Per els quadres de di\xe0leg que tenen diverses pestanyes, premi ALT + F10 per anar a la llista de pestanyes. Despr\xe9s podr\xe0 despla\xe7ar-se a la seg\xfcent pestanya amb TAB o RIGHT ARROW. Anar a la pestanya anterior amb SHIFT + TAB o LEFT ARROW. Premi SPACE o ENTER per seleccionar la pestanya."},{name:"Editor de men\xfa contextual",legend:"Premi ${contextMenu} o APPLICATION KEY per obrir el men\xfa contextual. Despr\xe9s desplacis a la seg\xfcent opci\xf3 del men\xfa amb TAB o DOWN ARROW. Desplacis a l'anterior opci\xf3 amb SHIFT+TAB o UP ARROW. Premi SPACE o ENTER per seleccionar l'opci\xf3 del men\xfa. Obri el submen\xfa de l'actual opci\xf3 utilitzant SPACE o ENTER o RIGHT ARROW. Pot tornar a l'opci\xf3 del men\xfa pare amb ESC o LEFT ARROW. Tanqui el men\xfa contextual amb ESC."},{name:"Editor de caixa de llista",legend:"Dins d'un quadre de llista, desplacis al seg\xfcent element de la llista amb TAB o DOWN ARROW. Desplacis a l'anterior element de la llista amb SHIFT + TAB o UP ARROW. Premi SPACE o ENTER per seleccionar l'opci\xf3 de la llista. Premi ESC per tancar el quadre de llista."},{name:"Editor de barra de ruta de l'element",legend:"Premi ${elementsPathFocus} per anar als elements de la barra de ruta. Desplacis al bot\xf3 de l'element seg\xfcent amb TAB o RIGHT ARROW. Desplacis a l'anterior bot\xf3 amb  SHIFT+TAB o LEFT ARROW. Premi SPACE o ENTER per seleccionar l'element a l'editor."}]},{name:"Ordres",items:[{name:"Desfer ordre",legend:"Premi ${undo}"},{name:"Refer ordre",legend:"Premi ${redo}"},{name:"Ordre negreta",legend:"Premi ${bold}"},{name:"Ordre cursiva",legend:"Premi ${italic}"},{name:"Ordre subratllat",legend:"Premi ${underline}"},{name:"Ordre enlla\xe7",legend:"Premi ${link}"},{name:"Ordre amagar barra d'eines",legend:"Premi ${toolbarCollapse}"},{name:"Ordre per accedir a l'anterior espai enfocat",legend:"Premi ${accessPreviousSpace} per accedir a l'enfocament d'espai m\xe9s proper inabastable abans del s\xedmbol d'intercalaci\xf3, per exemple: dos elements HR adjacents. Repetiu la combinaci\xf3 de tecles per arribar a enfocaments d'espais distants."},{name:"Ordre per accedir al seg\xfcent espai enfocat",legend:"Premi ${accessNextSpace} per accedir a l'enfocament d'espai m\xe9s proper inabastable despr\xe9s del s\xedmbol d'intercalaci\xf3, per exemple: dos elements HR adjacents. Repetiu la combinaci\xf3 de tecles per arribar a enfocaments d'espais distants."},{name:"Ajuda d'accessibilitat",legend:"Premi ${a11yHelp}"}]}],backspace:"Backspace",tab:"Tab",enter:"Enter",shift:"Shift",ctrl:"Ctrl",alt:"Alt",pause:"Pause",capslock:"Caps Lock",escape:"Escape",pageUp:"Page Up",pageDown:"Page Down",end:"End",home:"Home",leftArrow:"Left Arrow",upArrow:"Up Arrow",rightArrow:"Right Arrow",downArrow:"Down Arrow",insert:"Insert","delete":"Delete",leftWindowKey:"Left Windows key",rightWindowKey:"Right Windows key",selectKey:"Select key",numpad0:"Numpad 0",numpad1:"Numpad 1",numpad2:"Numpad 2",numpad3:"Numpad 3",numpad4:"Numpad 4",numpad5:"Numpad 5",numpad6:"Numpad 6",numpad7:"Numpad 7",numpad8:"Numpad 8",numpad9:"Numpad 9",multiply:"Multiply",add:"Add",subtract:"Subtract",decimalPoint:"Decimal Point",divide:"Divide",f1:"F1",f2:"F2",f3:"F3",f4:"F4",f5:"F5",f6:"F6",f7:"F7",f8:"F8",f9:"F9",f10:"F10",f11:"F11",f12:"F12",numLock:"Num Lock",scrollLock:"Scroll Lock",semiColon:"Semicolon",equalSign:"Equal Sign",comma:"Comma",dash:"Dash",period:"Period",forwardSlash:"Forward Slash",graveAccent:"Grave Accent",openBracket:"Open Bracket",backSlash:"Backslash",closeBracket:"Close Bracket",singleQuote:"Single Quote"});